import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
import Menu from '@mui/material/Menu';
import MenuIcon from '@mui/icons-material/Menu';
import Container from '@mui/material/Container';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import Tooltip from '@mui/material/Tooltip';
import MenuItem from '@mui/material/MenuItem';
import AdbIcon from '@mui/icons-material/Adb';
import {styled} from "@mui/material";

const pages = ['The project', 'Documentation', 'Download'];

function Navbar() {
    const [anchorElNav, setAnchorElNav] = React.useState(null);

    const handleOpenNavMenu = (event) => {
        setAnchorElNav(event.currentTarget);
    };
    const handleCloseNavMenu = () => {
        setAnchorElNav(null);
    };
    function handleClickButton(page) {
        console.log(page);
        if (page === 'Documentation') {
            function Documentation() {
                const handleClick = () => {
                    window.open('/documentation/html/index.html', '_blank');
                };

                return (
                    <div>
                        <h1>Documentation</h1>
                        <Button variant="contained" onClick={handleClick}>
                            Télécharger la documentation
                        </Button>
                    </div>
                );
            }
        }
        else {
            const section = document.getElementById(page);
            section.scrollIntoView({behavior: "smooth", inline: "nearest"});
        }
    }
    const StyledAppBar = styled(AppBar)({
        backgroundColor: '#34404d',
        borderBottom: '2px solid #FFFFFF',
    });

    return (
        <StyledAppBar position="static">
            <Container maxWidth="xl" >
                <Toolbar disableGutters>
                    <a href="/" >
                    <img src={"https://upload.wikimedia.org/wikipedia/fr/6/64/R-Type_Logo.png"} width={190} height={70} alt="R-Type logo"></img>
                    </a>
                    <Box sx={{ width: 50 }}/>
                    <Box sx={{ flexGrow: 1, display: { xs: 'flex', md: 'none' } }}>
                        <IconButton
                            size="large"
                            aria-label="account of current user"
                            aria-controls="menu-appbar"
                            aria-haspopup="true"
                            onClick={handleOpenNavMenu}
                            color="inherit"
                        >
                            <MenuIcon />
                        </IconButton>
                        <Menu
                            id="menu-appbar"
                            anchorEl={anchorElNav}
                            anchorOrigin={{
                                vertical: 'bottom',
                                horizontal: 'left',
                            }}
                            keepMounted
                            transformOrigin={{
                                vertical: 'top',
                                horizontal: 'left',
                            }}
                            open={Boolean(anchorElNav)}
                            onClose={handleCloseNavMenu}
                            sx={{
                                display: { xs: 'block', md: 'none' },
                            }}
                        >
                            {pages.map((page) => (
                                <MenuItem key={page} onClick={() => handleClickButton(page)}>
                                    <Typography textAlign="center">{page}</Typography>
                                </MenuItem>
                            ))}
                        </Menu>
                    </Box>
                    <Box sx={{ flexGrow: 1, display: { xs: 'none', md: 'flex' } }}>
                        {pages.map((page) => (
                            <Button
                                key={page}
                                onClick={() => handleClickButton(page)}
                                sx={{ my: 2, color: 'white', display: 'block' }}
                            >
                                {page}
                            </Button>
                        ))}
                    </Box>
                </Toolbar>
            </Container>
        </StyledAppBar>
    );
}
export default Navbar;
